import React from 'react';
import {
  Box,
  Grid,
  Heading,
  Text,
  useColorModeValue,
  Flex,
  Icon,
  CircularProgress,
  CircularProgressLabel,
  Stat,
  StatLabel,
  StatNumber,
  StatHelpText,
  StatArrow,
} from '@chakra-ui/react';
import { FiTrendingUp, FiShield, FiAlertTriangle } from 'react-icons/fi';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler
);

const AnalyticsDashboard = () => {
  const bgCard = useColorModeValue('white', 'gray.800');
  const borderColor = useColorModeValue('gray.200', 'gray.700');

  const threatData = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      {
        label: 'Threats Detected',
        data: [65, 59, 80, 81, 56, 55],
        fill: true,
        backgroundColor: 'rgba(129, 140, 248, 0.1)',
        borderColor: '#818cf8',
        tension: 0.4,
      },
    ],
  };

  const options = {
    responsive: true,
    plugins: {
      legend: {
        display: false,
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        grid: {
          display: false,
        },
      },
      x: {
        grid: {
          display: false,
        },
      },
    },
  };

  return (
    <Box p={4}>
      <Heading size="lg" mb={6} color={useColorModeValue('gray.700', 'white')}>
        Security Analytics
      </Heading>

      <Grid templateColumns={{ base: '1fr', md: 'repeat(3, 1fr)' }} gap={6} mb={8}>
        <Flex
          direction="column"
          bg={bgCard}
          p={6}
          borderRadius="2xl"
          border="1px"
          borderColor={borderColor}
          boxShadow="sm"
        >
          <Flex align="center" mb={4}>
            <CircularProgress value={78} size="100px" thickness="8px" color="green.400">
              <CircularProgressLabel>78%</CircularProgressLabel>
            </CircularProgress>
            <Box ml={4}>
              <Text fontSize="lg" fontWeight="medium" mb={1}>
                System Health
              </Text>
              <Text fontSize="sm" color="gray.500">
                Overall security status
              </Text>
            </Box>
          </Flex>
          <Stat>
            <StatLabel>Improvement</StatLabel>
            <StatHelpText>
              <StatArrow type="increase" />
              23.36%
            </StatHelpText>
          </Stat>
        </Flex>

        <Box
          bg={bgCard}
          p={6}
          borderRadius="2xl"
          border="1px"
          borderColor={borderColor}
          boxShadow="sm"
        >
          <Flex align="center" mb={4}>
            <Icon as={FiTrendingUp} w={8} h={8} color="purple.500" />
            <Text ml={3} fontSize="lg" fontWeight="medium">
              Threat Analysis
            </Text>
          </Flex>
          <Line data={threatData} options={options} height="100" />
        </Box>

        <Flex
          direction="column"
          bg={bgCard}
          p={6}
          borderRadius="2xl"
          border="1px"
          borderColor={borderColor}
          boxShadow="sm"
        >
          <Text fontSize="lg" fontWeight="medium" mb={4}>
            Quick Stats
          </Text>
          <Grid templateColumns="repeat(2, 1fr)" gap={4}>
            <Stat>
              <StatLabel>Active Threats</StatLabel>
              <StatNumber>3</StatNumber>
              <StatHelpText>
                <StatArrow type="decrease" />
                14.3%
              </StatHelpText>
            </Stat>
            <Stat>
              <StatLabel>Blocked Attacks</StatLabel>
              <StatNumber>147</StatNumber>
              <StatHelpText>
                <StatArrow type="increase" />
                28.5%
              </StatHelpText>
            </Stat>
          </Grid>
        </Flex>
      </Grid>
    </Box>
  );
};

export default AnalyticsDashboard;
